import React, { useState } from 'react';

const DeleteAccount = ({ userId }) => {
  const [deleteStatus, setDeleteStatus] = useState(null);

  const handleDeleteAccount = () => {
    try {
      // Simulate account deletion by clearing user data from localStorage
      localStorage.removeItem('user'); // replace 'user' with your actual storage key

      setDeleteStatus('User deleted successfully');
    } catch (error) {
      console.error('Error deleting account:', error.message);
      setDeleteStatus('An error occurred while deleting the account.');
    }
  };

  return (
    <div>
      <h1>User Profile</h1>
      <p>User ID: {userId}</p>
      {deleteStatus && <p>{deleteStatus}</p>}
      <button onClick={handleDeleteAccount}>Delete Account</button>
    </div>
  );
};

export default DeleteAccount;
